  false,\n\t\"url\": null,\n\t\"notes\": \"Working cooperatively with the USFWS, the
  University of Minnesota Department of Forest Resources has been compiling geo-referenced
  data for each national wildlife refuge in USFWS Region 3 since the fall of 1997.
  A standardized list of data sets, at three different spatial extents, has been developed
  (Appendix A).  The regional extent typically covers multiple counties, and general,
  small-scale data layers such as vegetation, lakes, rivers and highways are collected
  which place the refuge in human and ecological contexts. More detailed data layers,
  such as streams, wetlands, and roads, are kept at the watershed extent (covering,
  at a minimum, the watershed in which the refuge lies). Finally, refuge-specific
  layers such as management plans, wildlife habitat, and real property inventory,
  are collected only within the refuge boundaries. This report outlines the data for
  Seney National Wildlife Refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
